import { Route, Routes } from 'react-router-dom';
import './App.css';
import Navbar from './components/Navbar/Navbar';
import Homepage from './pages/homepage'; // Capitalize the component name

function App() {
  return (
    <div className="App">
      <Navbar />
      <Routes>
        {/* Use 'element' instead of 'component' */}
        <Route path="/" element={<Homepage />} />
      </Routes>
    </div>
  );
}

export default App;
